import React, { useState, useEffect } from 'react';
import { Card, Form, Button, Alert } from 'react-bootstrap';
import axios from 'axios';

const Reports = ({ role }) => {
  const [formData, setFormData] = useState({
    faculty_name: '',
    class_name: '',
    week_of_reporting: '',
    date_of_lecture: '',
    course_name: '',
    course_code: '',
    lecturer_name: '',
    actual_students: '',
    total_registered: '',
    venue: '',
    scheduled_time: '',
    topic_taught: '',
    learning_outcomes: '',
    recommendations: ''
  });

  const [reports, setReports] = useState([]);
  const [error, setError] = useState(null);

  const onChange = (e) =>
    setFormData({ ...formData, [e.target.name]: e.target.value });

  const fetchReports = async () => {
    const token = localStorage.getItem('token');
    if (!token) {
      setError('No authentication token. Please log in.');
      return;
    }

    try {
      const res = await axios.get(`${process.env.REACT_APP_API_URL}/reports`, {
        headers: { 'x-auth-token': token }
      });
      setReports(res.data);
    } catch (err) {
      console.error(err);
      setError(err.response?.data?.msg || 'Failed to fetch reports');
    }
  };

  const onSubmit = async (e) => {
    e.preventDefault();
    const token = localStorage.getItem('token');
    if (!token) {
      setError('No token found. Please log in.');
      return;
    }

    try {
      const submitData = {
        faculty_name: formData.faculty_name,
        class_name: formData.class_name,
        week_of_reporting: parseInt(formData.week_of_reporting) || 0,
        date_of_lecture: new Date(formData.date_of_lecture).toISOString().split('T')[0],
        course_name: formData.course_name,
        course_code: formData.course_code,
        lecturer_name: formData.lecturer_name,
        actual_number_of_students_present: parseInt(formData.actual_students) || 0,
        total_number_of_registered_students: parseInt(formData.total_registered) || 0,
        venue: formData.venue,
        scheduled_lecture_time: formData.scheduled_time,
        topic_taught: formData.topic_taught,
        learning_outcomes: formData.learning_outcomes,
        recommendations: formData.recommendations
      };

      await axios.post(`${process.env.REACT_APP_API_URL}/reports`, submitData, {
        headers: { 'x-auth-token': token }
      });

      alert('Report submitted successfully');
      setFormData({
        faculty_name: '', class_name: '', week_of_reporting: '', date_of_lecture: '',
        course_name: '', course_code: '', lecturer_name: '', actual_students: '',
        total_registered: '', venue: '', scheduled_time: '', topic_taught: '',
        learning_outcomes: '', recommendations: ''
      });

      fetchReports();
    } catch (err) {
      console.error(err);
      setError(err.response?.data?.msg || 'Failed to submit report');
    }
  };

  useEffect(() => {
    fetchReports();
  }, []);

  return (
    <Card className="p-4">
      <h2>Submit Report</h2>
      {error && <Alert variant="danger">{error}</Alert>}
      <Form onSubmit={onSubmit}>
        <Form.Group className="mb-3">
          <Form.Label>Faculty Name</Form.Label>
          <Form.Control name="faculty_name" value={formData.faculty_name} onChange={onChange} required />
        </Form.Group>
        <Form.Group className="mb-3">
          <Form.Label>Class Name</Form.Label>
          <Form.Control name="class_name" value={formData.class_name} onChange={onChange} required />
        </Form.Group>
        <Form.Group className="mb-3">
          <Form.Label>Week of Reporting</Form.Label>
          <Form.Control type="number" name="week_of_reporting" value={formData.week_of_reporting} onChange={onChange} required />
        </Form.Group>
        <Form.Group className="mb-3">
          <Form.Label>Date of Lecture</Form.Label>
          <Form.Control type="date" name="date_of_lecture" value={formData.date_of_lecture} onChange={onChange} required />
        </Form.Group>
        <Form.Group className="mb-3">
          <Form.Label>Course Name</Form.Label>
          <Form.Control name="course_name" value={formData.course_name} onChange={onChange} required />
        </Form.Group>
        <Form.Group className="mb-3">
          <Form.Label>Course Code</Form.Label>
          <Form.Control name="course_code" value={formData.course_code} onChange={onChange} required />
        </Form.Group>
        <Form.Group className="mb-3">
          <Form.Label>Lecturer Name</Form.Label>
          <Form.Control name="lecturer_name" value={formData.lecturer_name} onChange={onChange} required />
        </Form.Group>
        <Form.Group className="mb-3">
          <Form.Label>Actual Students Present</Form.Label>
          <Form.Control type="number" name="actual_students" value={formData.actual_students} onChange={onChange} required />
        </Form.Group>
        <Form.Group className="mb-3">
          <Form.Label>Total Registered Students</Form.Label>
          <Form.Control type="number" name="total_registered" value={formData.total_registered} onChange={onChange} required />
        </Form.Group>
        <Form.Group className="mb-3">
          <Form.Label>Venue</Form.Label>
          <Form.Control name="venue" value={formData.venue} onChange={onChange} required />
        </Form.Group>
        <Form.Group className="mb-3">
          <Form.Label>Scheduled Time</Form.Label>
          <Form.Control name="scheduled_time" value={formData.scheduled_time} onChange={onChange} required />
        </Form.Group>
        <Form.Group className="mb-3">
          <Form.Label>Topic Taught</Form.Label>
          <Form.Control name="topic_taught" value={formData.topic_taught} onChange={onChange} required />
        </Form.Group>
        <Form.Group className="mb-3">
          <Form.Label>Learning Outcomes</Form.Label>
          <Form.Control name="learning_outcomes" value={formData.learning_outcomes} onChange={onChange} required />
        </Form.Group>
        <Form.Group className="mb-3">
          <Form.Label>Recommendations</Form.Label>
          <Form.Control name="recommendations" value={formData.recommendations} onChange={onChange} required />
        </Form.Group>

        <Button variant="primary" type="submit">Submit Report</Button>
      </Form>

      <h3 className="mt-4">Reports</h3>
      {reports.length ? (
        <ul>
          {reports.map((report) => (
            <li key={report.id}>{report.topic_taught} ({report.date_of_lecture})</li>
          ))}
        </ul>
      ) : (
        <p>No reports available.</p>
      )}
    </Card>
  );
};

export default Reports;
